- input: TEXT,F3XA,,"1 - Actions taken regarding this issue are described in the committee's
    filing (FEC-169296) on 4/05/2005.  2 - The disbursements for telemarketing fees
    did not support or oppose any federal candidate.  3 - These disbursements did
    not support promote or attack any federal candidate.  4 - The descriptions for
    these disbursements have been clarified.  5 - Text records have been included
    for each of the disbursements referenced.  6.  No employee of the committee spent
    more than 25% of their time during the reporting period working on any Federal
    Election Activity or activities in connection with a Federal Election. Therefore
    salary payments were made for directly from a non-federal account.  7 - These
    payments are related to activity which occured on 11/12/2004 and therefore are
    not related to any federal election.  8 - These disbursements have been clarified
    and did not promote or attack any federal candidate.  9 - These disbursements
    have been clarified and are assigned to the correct allocable activity.  10 -
